import './App.css';
import React from 'react';
import { useNavigate } from 'react-router-dom';

export function App() {
  const navigate = useNavigate();
  return (
    <div className="App">
      <h1>hello</h1>
      <button type ="button" onClick={() => navigate('/sign')}>submit</button>
    </div>
  );
}

export default App;
